import Header from "./components/Header/Header";
import Main from "./components/Main/Main";
import Footer from "./components/Footer/Footer";
import WhatsAppButton from "./components/WhatsAppButton/WhatsAppButton";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Header />
      <WhatsAppButton />
      <Main />

      <Footer />
    </div>
  );
}

export default App;
